function jal_install () {
    
    global $wpdb;
    $table_name = $wpdb->prefix . "tpv_mixer";
    $charset_collate = $wpdb->get_charset_collate();
    $sql = "DROP TABLE IF EXISTS $table_name";
    $wpdb->query($sql);
    $sql = "CREATE TABLE $table_name (
      tpv_id mediumint(9) NOT NULL AUTO_INCREMENT,
      time datetime DEFAULT '0000-00-00 00:00:00' NOT NULL,
      url varchar(255) DEFAULT '' NOT NULL,
      timezone varchar(63) DEFAULT '' NOT NULL,
      phone_no varchar(63) DEFAULT '' NOT NULL,
      website varchar(123) DEFAULT '' NOT NULL,
      instructions TEXT  NOT NULL,
      title VARCHAR(63) NOT NULL,
      colour_disclaimer TEXT  NOT NULL,
      background_colour VARCHAR(63) NOT NULL,
      text_colour VARCHAR(63) NOT NULL,
      text_font VARCHAR(63) NOT NULL,
      pdf_header_text VARCHAR(63) NOT NULL,
      select_color VARCHAR(63) NOT NULL,
      PRIMARY KEY  (tpv_id)
    ) $charset_collate;";
    //$sql = "ALTER TABLE $table_name ALTER COLUMN url VARCHAR (255);";
    require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );
    dbDelta( $sql );
   /* $wpdb->insert( 
    $table_name, 
    array( 
        'time'     => date('Y-m-d H:i:s'),
        'url'    => 'https://rosehillsportsandplay.com/wp-content/uploads/2020/09/rosehill_sportsandplay_social_1200x630.png',
        'timezone' => '',
        'phone_no'   => "0044(0)1422 839 456",
        'website'      => 'rosehillsportsandplay.com',
        'instructions'=> $instruction_text,
        'title'  => 'Instruction',
        'colour_disclaimer'  => $colour_disclaimer,
        'background_colour'  => '#f4f4f4',
        'text_colour'  => '#273476',
        'text_font' => 'arial, helvetica, sans-serif;',
        'pdf_header_text' => 'Rosehill TPV Colour Mixer'
     )
    );*/
    $date=date('Y-m-d H:i:s');
    $instruction_text = '<p>With the Rosehill TPV® Colour Mixer you can design the perfect blend for your next project. Mix bespoke colours to suit any brief by combining two or more of our 22 coloured rubber granules.</p>
                    <p>Select your colours from the swatches below.</p>
                    <p><strong>Use the + buttons to add granules and the - buttons to remove them.</strong></p>
                    <p>When you have finished your design, save or print it as a PDF.</p>
                    <p><a href="https://rosehillsportsandplay.com/rosehilltpv/" target="_blank">Click here to find out more about Rosehill TPV® Coloured Rubber Granules.</a></p>';
    $colour_disclaimer= 'Colour Disclaimer Do not rely on screen representation for colour accuracy. We cannot guarantee an exact
match and the colour appearing on screen should not be relied on as being such, swatch colours will vary
depending on your screen settings. ';               
    $sql = "Insert into $table_name set time='{$date}',url='https://rosehillsportsandplay.com/wp-content/uploads/2020/09/rosehill_sportsandplay_social_1200x630.png',timezone = '',phone_no='0044(0)1422 839 456',website = 'rosehillsportsandplay.com',instructions= '{$instruction_text}',title  = 'Instruction',colour_disclaimer= '{$colour_disclaimer}',background_colour='#f4f4f4',text_colour='#273476',text_font='{$text_font};',
        pdf_header_text='Rosehill TPV Colour Mixer'";
    $record_id = $wpdb->query( $sql );
    if(!$record_id) {  echo $sql;exit; }
    
     
}
